let style = {
    width: 40,
    height: 30,
    backgroundColor: "#063b50",
    margin: "10px 0 0 10px",
    borderRadius: '0 5px 5px 0'
}

let settingsLine = {
    width: 25,
    height: 1,
    backgroundColor: 'white',
    margin: 'auto'
}

export default function Settings() {
    return (
        <div style={style}>
            <div style={{...settingsLine, marginTop: 5}}></div>
            <div style={{...settingsLine, marginTop: 10}}></div>
            <div style={{...settingsLine, marginTop: 15}}></div>
        </div>
    )
}
